  <script>
    

    // Exibe uma tela inicial aguardando interação
    async function showStartScreen(callback) {
      createDiv(100, 100, "game_tv", "center", "startScreen");

      const startDiv = document.getElementById("startScreen");
      startDiv.style.background = "black";
      startDiv.style.display = "flex";
      startDiv.style.alignItems = "center";
      startDiv.style.justifyContent = "center";
      startDiv.style.color = "white";
      startDiv.style.fontFamily = "monospace";
      startDiv.style.fontSize = "24px";
      startDiv.innerText = "Clique para iniciar";
      //write(0x00, "Clique para iniciar", 70, 1, "startScreen", "white");

      const startHandler = () => {
        document.removeEventListener("click", startHandler);
        document.removeEventListener("keydown", startHandler);
        document.removeEventListener("touchstart", startHandler);

        startDiv.remove();
        callback();
      };

      document.addEventListener("click", startHandler);
      document.addEventListener("keydown", startHandler);
      document.addEventListener("touchstart", startHandler);
    }

    function loadSprite(
      startIndex,
      endIndex,
      delaySeconds,
      repeatCount,
      pauseAtEnd,
      removeDelay,
      containerId = null,
      fadeTime = 0
    ) {
      const img = new Image();
      img.style.imageRendering = "pixelated";
      img.style.opacity = 0;
      img.style.display = "block"; // Garante que o elemento seja exibido como bloco
      img.style.margin = "0 auto"; // Centraliza horizontalmente
      img.style.width = "100%"; // Ajusta a largura para 100% do container
      img.style.height = "auto"; // Mantém a proporção da altura
      if (fadeTime > 0) {
        img.style.transition = `opacity ${fadeTime}s`;
      }

      const container = containerId
        ? document.getElementById(containerId)
        : document.body;
      if (!container) {
        throw new Error(`Elemento com id "${containerId}" não encontrado`);
      }
      container.appendChild(img);

      const frameKeys = [];
      for (let i = startIndex; i <= endIndex; i++) {
        if (sprites[i]) frameKeys.push(i);
      }

      let frame = 0;
      let repeat = 0;
      let playing = true;

      // Define o primeiro frame já na img, com opacidade 0
      img.src = "data:image/png;base64," + sprites[frameKeys[frame]];

      function startAnimation() {
        frame++; // já mostramos o frame 0, começa do 1

        function showFrame() {
          if (!playing) return;

          img.src = "data:image/png;base64," + sprites[frameKeys[frame]];
          frame++;

          if (frame >= frameKeys.length) {
            repeat++;
            if (repeat >= repeatCount) {
              if (pauseAtEnd) {
                img.src =
                  "data:image/png;base64," +
                  sprites[frameKeys[frameKeys.length - 1]];
                if (fadeTime > 0) {
                  img.style.opacity = 0;
                  setTimeout(() => {
                    container.removeChild(img);
                  }, fadeTime * 1000 + removeDelay * 1000);
                } else {
                  setTimeout(() => {
                    container.removeChild(img);
                  }, removeDelay * 1000);
                }
              } else {
                if (fadeTime > 0) {
                  img.style.opacity = 0;
                  setTimeout(() => {
                    container.removeChild(img);
                  }, fadeTime * 1000);
                } else {
                  container.removeChild(img);
                }
              }
              playing = false;
              return;
            }
            frame = 0;
          }

          if (delaySeconds === 0) {
            requestAnimationFrame(showFrame);
          } else {
            setTimeout(showFrame, delaySeconds * 1000);
          }
        }

        showFrame();
      }

      if (fadeTime > 0) {
        // Quando a transição do fade-in terminar, inicia a animação
        function onFadeInEnd(e) {
          if (e.propertyName === "opacity") {
            img.removeEventListener("transitionend", onFadeInEnd);
            startAnimation();
          }
        }
        img.addEventListener("transitionend", onFadeInEnd);

        // Força o fade-in (opacity 1) após forçar layout
        requestAnimationFrame(() => {
          img.style.opacity = 1;
        });
      } else {
        // Sem fade, já começa a animação direto
        img.style.opacity = 1;
        startAnimation();
      }

      return {
        stop: () => {
          playing = false;
        },
        remove: () => {
          playing = false;
          if (fadeTime > 0) {
            img.style.opacity = 0;
            setTimeout(() => {
              if (img.parentNode === container) container.removeChild(img);
            }, fadeTime * 1000);
          } else {
            if (img.parentNode === container) container.removeChild(img);
          }
        },
        element: img,
      };
    }

    // Para controlar quais fontes já foram registradas
    const registeredFonts = new Set();

    function registerFont(index) {
      if (registeredFonts.has(index)) return;

      const base64 = font[index];
      if (!base64) {
        console.warn(`Fonte para índice ${index} não encontrada.`);
        return;
      }

      const fontName = `font_${index.toString(16).padStart(2, "0")}`;

      // Criar o style com @font-face
      const style = document.createElement("style");
      style.textContent = `
        @font-face {
        font-family: '${fontName}';
        src: url(data:font/ttf;base64,${base64}) format('truetype');
        }
        `;
      document.head.appendChild(style);

      registeredFonts.add(index);
      return fontName;
    }

    function write(
      fontIndex,
      text,
      sizePx,
      opacity,
      targetId,
      color = "white"
    ) {
      const fontName = registerFont(fontIndex);
      if (!fontName) return;

      const target = document.getElementById(targetId);
      if (!target) {
        console.warn(`Elemento com id "${targetId}" não encontrado.`);
        return;
      }

      const span = document.createElement("span");
      span.textContent = text;
      span.style.fontFamily = fontName;
      span.style.fontSize = `${sizePx}px`;
      span.style.opacity = opacity.toString();
      span.style.color = color; // <-- aqui a cor da fonte
      span.style.userSelect = "none";
      span.style.display = "inline-block";
      span.style.margin = "0 2px";

      target.appendChild(span);
    }

    function createDiv(
      wPercent,
      hPercent,
      containerId,
      position = "",
      newDivId = ""
    ) {
      const container = document.getElementById(containerId);
      if (!container) {
        throw new Error(`Elemento com id "${containerId}" não encontrado.`);
      }

      const div = document.createElement("div");

      // Define o ID da nova div, se informado
      if (newDivId) div.id = newDivId;

      // Tamanho em porcentagem
      div.style.width = wPercent + "%";
      div.style.height = hPercent + "%";
      div.style.position = "absolute";

      // Centralização
      if (position === "center") {
        div.style.left = "50%";
        div.style.top = "50%";
        div.style.transform = "translate(-50%, -50%)";
      }

      // Visual temporário
      //div.style.background = "rgba(0, 128, 255, 0.3)";
      //div.style.border = "1px dashed blue";

      container.appendChild(div);

      return div;
    }

    function playSound(index) {
      if (!mp3[index]) {
        console.error("Som não encontrado no índice:", index);
        return;
      }

      const byteString = atob(mp3[index]);
      const byteArray = new Uint8Array(byteString.length);
      for (let i = 0; i < byteString.length; i++) {
        byteArray[i] = byteString.charCodeAt(i);
      }

      const blob = new Blob([byteArray], { type: "audio/mpeg" });
      const url = URL.createObjectURL(blob);

      const audio = new Audio(url);
      audio.play().catch((err) => {
        console.warn("Erro ao tocar áudio:", err.message);
      });

      audio.onended = () => {
        URL.revokeObjectURL(url);
      };

      return audio;
    }

    async function playSoundExit(index, fun) {
      if (!mp3[index]) {
        console.error("Som não encontrado no índice:", index);
        return;
      }

      const byteString = atob(mp3[index]);
      const byteArray = new Uint8Array(byteString.length);
      for (let i = 0; i < byteString.length; i++) {
        byteArray[i] = byteString.charCodeAt(i);
      }

      const blob = new Blob([byteArray], { type: "audio/mpeg" });
      const url = URL.createObjectURL(blob);

      const audio = new Audio(url);
      audio.play().catch((err) => {
        console.warn("Erro ao tocar áudio:", err.message);
      });

      audio.onended = () => {
        URL.revokeObjectURL(url);
        clearScreen();
        if (typeof fun === "function") {
          fun(); // ← chama a função extra passada como parâmetro
        }
      };

      return audio;
    }

    function wait(seconds) {
      return new Promise((resolve) => setTimeout(resolve, seconds * 1000));
    }

    function playVideo(index, divId) {
      const base64Data = video[index];
      if (!base64Data) {
        console.error("Vídeo não encontrado.");
        return;
      }

      const videoElement = document.createElement("video");
      videoElement.src = "data:video/mp4;base64," + base64Data;
      videoElement.controls = true;
      videoElement.autoplay = true;
      videoElement.playsInline = true;
      videoElement.style.width = "100%";
      videoElement.style.height = "100%";
      videoElement.style.objectFit = "cover"; // preenche a div completamente
      videoElement.style.display = "block";
      videoElement.style.margin = "0";
      videoElement.style.padding = "0";
      videoElement.style.border = "none";

      const container = document.getElementById(divId);
      if (!container) {
        console.error("Div de destino não encontrada.");
        return;
      }

      // Importante: garantir que a div tenha altura e largura definidas
      container.style.width = "100%";
      container.style.height = "100%";
      container.style.overflow = "hidden"; // se necessário
      container.style.display = "block";

      container.innerHTML = "";
      container.appendChild(videoElement);
    }

    function clearScreen() {
      const container = document.getElementById("game_tv");
      if (container) {
        container.innerHTML = ""; // Limpa todo o conteúdo
      } else {
        console.warn("Elemento com id 'game_tv' não encontrado.");
      }
    }

    function main() {
      // Tudo normal a partir daqui
      bootScreen();
      
    }

    async function bootScreen() {
      createDiv(20, 20, "game_tv", "center", "bootLogoScreen");
      loadSprite(0x00, 0x19, 0.05, 2, true, 2, "bootLogoScreen", 1);
      //write(0x00, "Licenciado por [PGN]", 70, 1, "bootLogoScreen", "white");
      playSound(0x00);
      await wait(5); // Espera 5 segundos para a animação do logo
      clearScreen();
      title_0x00();
    }

    async function title_0x00() {
      createDiv(40, 20, "game_tv", "center", "titleScreen");

      write(0x00, "Licenciado por [PGN]", 30, 1, "titleScreen", "white");
      playSound(0x01);
      await wait(10); // Espera 2 segundos para a mensagem
      clearScreen();
      title_0xff();
    }

    async function title_0xff() {
      createDiv(100, 100, "game_tv", "center", "titleScreen");
      playVideo(0x00, "titleScreen");
    }

    window.addEventListener("DOMContentLoaded", () => {
      showStartScreen(main);
    });
  </script>
